import { LineChart } from '@mui/x-charts';

function Chart_m_3(props) {
    console.log("chart data: ", props)
  if(props.data == null || JSON.stringify(props.data) === "{}"){
    return(<div align="center">
      <p>Change parameters on the left to obtain graph</p>
    </div>)
  }
  else{
    return(
    <LineChart
      className="custom-line-chart"
      xAxis={[{ data: props.x , scaleType: 'band',  label: 'Years'}]}
      yAxis={[
        { id: 'y1', scaleType: 'linear', label: 'Foreign worker count' },
      ]}
      series={[
        { yAxisKey: 'y1', data: props.y1, label: 'AcceptanceRate' },
      ]}
      // leftAxis="y1"
      height={500}
      width={800}
    />
    )
  }
}

export default Chart_m_3;
